body.script:

function flip( show, hide ) {
	var showMe = document.getElementById(show);
	showMe.style.display='';
	var hideMe = document.getElementById(hide);
	hideMe.style.display='none';
}

var hash_value = location.hash;
if( hash_value == '#cpuvalue' ) {
	var showMe = document.getElementById('value');
	showMe.style.display='';
	var hideMe = document.getElementById('mark');
	hideMe.style.display='none';
} else {
	var showMe = document.getElementById('mark');
	showMe.style.display='';
	var hideMe = document.getElementById('value');
	hideMe.style.display='none';
}
